67_6" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(64) "Y son difíciles las entrevistas? Son en inglés obviamente, no?" ["created_time"]=> string(24) "2012-12-29T06:16:32+0000" } [3]=> array(4) { ["id"]=> string(17) "449833658398567_7" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(525) "100% en ingles, pues mira para uno de los que conocí alla que se llama Fernando Carbajal, ya era su 3ra entrevista de 3ra ronda y también en esta ultima le fue mal según él. A mi se me hiciero muy faciles y nada fuera de lo común, lo que si te recomiendo se que entrenes mucho tu ingles, y tu confianza: el ingles ya sabes como entrenarlo, tu confianza la entrenas leyendo y aprendiendo todo lo que puedas sobre programación para sentirte mas seguro, ademas de practicar hablando en publico y con personas importantes. " ["created_time"]=> string(24) "2012-12-29T06:19:37+0000" } [4]=> array(4) { ["id"]=> string(17) "449833658398567_8" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(131) "Ah y a propósito Fernando ya iba en Maestría, así que si no empiezas a aprender por tu parte la escuela no te lo enseñara hehe " ["created_time"]=> string(24) "2012-12-29T06:21:13+0000" } [5]=> array(4) { ["id"]=> string(17) "449833658398567_9" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(137) "En la entrevista tu peor enemigo son los nervios, si aprendes a controlarlos todo ira bien, claro siempre y cuando des tu mejor esfuerzo." ["created_time"]=> string(24) "2012-12-29T06:26:06+0000" } [6]=> array(4) { ["id"]=> string(18) "449833658398567_10" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(116) "Me parece bien. Espero mejorar mucho tengo 4 años aún. Y conoces a algún itic de este campus que lo haya logrado?" ["created_time"]=> string(24) "2012-12-29T06:28:37+0000" } [7]=> array(4) { ["id"]=> string(18) "449833658398567_11" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(224) "no lo conozco pero se dice que si hay una persona que se fue para alla, creo que su nombre era con E, Elio debe saber, o el Doc campos, o quiza lo estoy confundiendo con uno de Chihuahua, ya no se ni en que campus estoy hehe" ["created_time"]=> string(24) "2012-12-29T06:30:04+0000" } [8]=> array(4) { ["id"]=> string(18) "449833658398567_12" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(101) "Jaja, pues muchas gracias por resolver mis dudas, esperemos que se nos presenten buenas oportunidades" ["created_time"]=> string(24) "2012-12-29T06:31:56+0000" } [9]=> array(4) { ["id"]=> string(18) "449833658398567_13" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(447) "Veras que si, mientras sube tu curriculum aquí http://careers.microsoft.com/careers/en/us/internships.aspx, uno de los primeros que me entrevisto que se llama Luis Hector estuvo en 3 internships (3 veranos durante su carrera) antes de entrar full time a Microsoft. Ve consiguiendo experiencia para tu curriculum eso también les llama la atención, por ejemplo a mi me empezaron a prestar atención después de que empece a trabajar para Softtek." ["created_time"]=> string(24) "2012-12-29T06:36:08+0000" } [10]=> array(4) { ["id"]=> string(18) "449833658398567_14" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(140) "Ok gracias de nuevo, creo que tendré que adquirir experiencia y aprender más cosas antes de subirlo, pues acabo de iniciar la carrera.jaja" ["created_time"]=> string(24) "2012-12-29T06:39:11+0000" } [11]=> array(4) { ["id"]=> string(18) "449833658398567_15" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(141) "Depende de si ya traes algo de background en programación, si estas en ceros pues entonces quiza si te convenga solo estar al margen un rato" ["created_time"]=> string(24) "2012-12-29T06:40:08+0000" } [12]=> array(4) { ["id"]=> string(18) "449833658398567_16" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(22) "mientras agarras vuelo" ["created_time"]=> string(24) "2012-12-29T06:40:19+0000" } [13]=> array(4) { ["id"]=> string(18) "449833658398567_17" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(117) "Sólo estoy llevando un curso en línea de harvard que se llama cs50 es introducción a la ciencia de la computación" ["created_time"]=> string(24) "2012-12-29T06:41:35+0000" } [14]=> array(4) { ["id"]=> string(18) "449833658398567_18" ["from"]=> array(2) { ["name"]=> string(13) "Ricardo Euán" ["id"]=> string(15) "100001213951874" } ["message"]=> string(52) "Y se desarrollar algunos algoritmos básicos en Java" ["created_time"]=> string(24) "2012-12-29T06:42:03+0000" } [15]=> array(4) { ["id"]=> string(18) "449833658398567_19" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(199) "a pues eso ya es mucho, ya sabes programar en Java y entiendes como funciona, ahora entrale a resolver problemas de concursos y mejoraras mucho, paginas como la de UVa o project euler te seran utiles" ["created_time"]=> string(24) "2012-12-29T06:43:32+0000" } [16]=> array(4) { ["id"]=> string(18) "449833658398567_20" ["from"]=> array(2) { ["name"]=> string(12) "Angel Durán" ["id"]=> string(10) "1105762317" } ["message"]=> string(120) "conoce como implementar recursividad, backtracking, programación dinámica, y eso también te abrira la m